column5:
This attribute is calculated using columns TicketLanguage,RegionName,SupportAreaCWSID,ProductL1,ProductL2,ProductName columns comming from MDM(Master Data Management) source. Logic: RaveSupportServiceRequestDetails joined with MDMRaveEIDMapping based on  TicketLanguage,RegionName,SupportAreaCWSID,ProductL1,ProductL2,ProductName columns to get EngagementId as MDMEngagementId. Code logic: TempRave.join(
        MDMRaveEIDMapping,
        (
            (
                lower(MDMRaveEIDMapping.SupportLanguageName_MREIDM)
                == lower(TempRave.TicketLanguage)
            )
            & (
                lower(MDMRaveEIDMapping.RegionName_MREIDM)
                == F.when(
                    TempRave.RegionName.isNull(), lit("unspecified")
                ).otherwise(lower(TempRave.RegionName))
            )
            & (lower(MDMRaveEIDMapping.Tier) == lower(TempRave.CalcTierType))
            & (
                lower(MDMRaveEIDMapping.SupportAreaCWSID)
                == lower(TempRave.CWSID)
            )
            & (
                lower(MDMRaveEIDMapping.ProductL1)
                == F.when(
                    TempRave.RaveProductL1.isNull(), lit("unspecified")
                ).otherwise(lower(TempRave.RaveProductL1))
            )
            & (
                lower(MDMRaveEIDMapping.ProductL2)
                == F.when(
                    TempRave.RaveProductL2.isNull(), lit("unspecified")
                ).otherwise(lower(TempRave.RaveProductL2))
            )
            & (
                lower(MDMRaveEIDMapping.Productname)
                == F.when(
                    TempRave.RaveProductName.isNull(), lit("unspecified")
                ).otherwise(lower(TempRave.RaveProductName))
            )
        ),
        "left",
    )
